import './App.css';
import Logout from './components/Logout';
import Nav from './components/Nav';
import Home from './components/Home';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import { Grid, Container} from '@material-ui/core';
import {useState, useEffect} from 'react';
function App() {

  const [currentUser, setCurrentUser] = useState("");

  return(
    <Router>
      <Container maxWidth = "xl">
        <Grid container spacing = {3}>
            <Switch>
            <Route path = "/home" exact>
              <Nav id = "1" setCurrentUser = {setCurrentUser}/>
              <Home />
            </Route>
            <Route exact path="/">
              <Redirect to="/home" /> 
            </Route>
            <Route path = "/profile">
              <Nav id = "2" setCurrentUser = {setCurrentUser}/>
              <Profile />
            </Route>
            <Route path = "/about">
              <Nav id = "3" setCurrentUser = {setCurrentUser}/>
              <About />
            </Route>
            <Route path = "/logout">
              <Logout setCurrentUser = {setCurrentUser}/>
            </Route>
          </Switch>
          </Grid>
      </Container>
    </Router>
  );
}

export default App;

function About(){
  return <Grid container item xs = {9}><h1>About</h1></Grid>;
}

function Profile(){
